import React from 'react'
import CartItem from './CartItem'

export default function CartList({value,funcs}) {
    const {cart} = value
    const {functs} = funcs
    
    console.log(value,cart,);

    return (
        <div className = "container-fluid">
            {cart.map(item =>{
                return <CartItem key = {item.id} item = {item} value = {value} funcs = {functs} /> 
            })}
        </div>
    )
}
